name = 'sigmaScattering'


def plotDualYAxis(x, time, eff, seeds, trueSeeds, x_label):
    allToFloat(time, eff, seeds, trueSeeds)
    red = 'tab:red'
    fig, (axEff) = plt.subplots()
    fig.suptitle('Seeding Algorithm Performance')
    axEff.plot(x, eff, '-o', color=red, label='maxSeedsPerSpM=1')
    axEff.set_ylabel('Efficiency %', color=red)
    axEff.set_xlabel(x_label)
    axEff.tick_params(axis='y', labelcolor=red)

    axSeeds = axEff.twinx()

    blue = 'tab:blue'
    axSeeds.plot(x, seeds, '-o', color=blue, label='maxSeedsPerSpM=1')
    axSeeds.set_ylabel('nSeeds', color=blue)
    axSeeds.tick_params(axis='y', labelcolor=blue)
    fig.tight_layout()


def plotSigEff(x, sigScats, effs, x_label):
    red = 'tab:red'
    fig, (axEff) = plt.subplots()
    fig.suptitle('Seeding Algorithm Performance')
    axEff.plot(x, effs, '-o', color=red)
    axEff.set_ylabel('Efficiency %', color=red)
    axEff.set_xlabel(x_label)
    axEff.tick_params(axis='y', labelcolor=red)

    axSeeds = axEff.twinx()

    blue = 'tab:blue'
    axSeeds.plot(x, sigmaScats, '-o', color=blue)
    axSeeds.set_ylabel('sigmaScattering', color=blue)
    axSeeds.tick_params(axis='y', labelcolor=blue)
    fig.tight_layout()

def plotTwoDual(x, eff1, eff2, seeds1, seeds2):
    allToFloat(eff1, eff2, seeds1, seeds2)
    red = 'tab:red'
    fig, (axEff) = plt.subplots()
    fig.suptitle('Seeding Algorithm Performance')
    axEff.plot(x, eff1, '-o', color=red, label='maxSeedsPerSpM=1')
    axEff.set_ylabel('Efficiency', color=red)
    axEff.set_xlabel('Sigmas of Scattering')
    axEff.tick_params(axis='y', labelcolor=red)

    axSeeds = axEff.twinx()

    blue = 'tab:blue'
    axSeeds.plot(x, seeds1, '-o', color=blue, label='maxSeedsPerSpM=1')
    axSeeds.set_ylabel('nSeeds', color=blue)
    axSeeds.tick_params(axis='y', labelcolor=blue)
    axEff.plot(x2, eff2, '--o', color=red, label='maxSeedsPerSpM=2')
    axSeeds.plot(x2, seeds2, '--o', color=blue, label='maxSeedsPerSpM=2')
    axEff.legend(loc='best', fontsize='medium')
    fig.tight_layout()

